Like Indian? Don't like the calories associated with it? These ingredients make a fantastic alternative to the crazy calorie based sauces associated with Indian Takeaways👌

@mickey_harkin I can't take credit for this amazing invention.

I don't count quantities but use half a carton of pasata, tablespoon of pesto and 3 tablespoons of Greek yogurt. I also add water to make it more liquid. I use it for veggie feast with chickpeas and prawns/Quorn. Alternatively you can use chicken and serve up with some rice🙋‍♀️🙋‍♀️🙋‍♀️ #fakeaway #saturdaynight #noms #healthylifestyle #healthyalternative #fitgirl #fitlife #fitlifestyle #fitfam #irishfitfam
